import React from "react";
import { add, sub, mul, div } from "./Calc";

function App() {
  return (
    <>
      <ul>
        <li>the addition of two numbers {add(40, 4)}</li>
        <li>the subtraction of two numbers {sub(40, 4)}</li>
        <li>the multipliation of two numbers {mul(40, 4)}</li>
        <li>the division of two numbers {div(40, 3)}</li>
      </ul>
    </>
  );
}

export default App;
